import React, { Component } from 'react';
import './List.css';

export default class List extends Component {
	render() {
		return (
			<div>
				<div className="list">
					<div className="list-heading">
						<h4>Lista to-do</h4>
						<hr />
					</div>
				</div>
			</div>
		);
	}
}
